met Tom Riley, Carmen Electra en Eddie Marsan

Wannabe producer Joe (Tom Riley) en diens getalenteerde maar zeer neurotische wannabe regisseur Baggy (Tom Burke) leuren met hun 
script langs productiemaatschappijen in Londen. Na een lange weg zonder succes krijgen beide vrienden een contract bij een 
wanhopige producer. De ster van de film, Candy Fiveways, een legendarische pornoactrice, moet echter nog gestrikt worden. Met 
haar deelname aan de film denkt het duo alles voor elkaar te hebben. Het moeilijkste moet echter nog komen: hoe neem je een film 
met de nodige sexscene's op in het huis van je ouders?.
